:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Edward Marsh and DAVIS, Jane
  JWILLIAMS, Thomas Sydney and WILLIAMS, Agnes Lydia
  WILLIAMS, Harold Edward and WALLIS, Elsie Nora Underwood
  WILLIAMS, Peter Wallis and GARDNER, Susan Mary
  3> WILLIAMS, Peter Wallism on 17.12.1960 to (1) GARDNER, Susan Mary
  b 22.03.1934
  b 20.04.1939
  Peter m. at Holy Trinity Church, Gisborne, Divorced 27.01.1988. Susan, d/o Jack and Leslie Gardner.
  Peter was educated at Hereworth School, Wanganui Collegiate School and Canterbury University College
  School of Art. He gained farming experience on Gisborne sheep stations before farming on his own
  account at Ormond. He later moved to Otoko, Gisborne. Sue encouraged him in his pastime of art which
  led to success in Kelliher art competition and to exhibitions in New Zealand, Australia, England,
  France and the USA.
  Refer to "A Huguenot Family. The Descendants of John and Mary Mandeno" published by Evagean Publishing
  in 1997 for records of Susan's family.
  01> WILLIAMS, Harold Michael m on 09.11.1996 to HANNON, Janet Lynne
  b 06.05.1962
  b 08.08.1968
  Harold b. at Gisborne and m. at Toorak, Melbourne. Janet, d/o Michael and
  Berta Hannon, b. at Glen Waverley, Melbourne Address: 7 Hall Street,
  Clifton Hill, Vic, Australia.
  Harold was educated in Gisborne, at Hereworth School and Wanganui
  Collegiate School and at Universities in the USA and Australia. He is a
  gifted artist and has taught computer graphics in Melbourne. He plays
  tennis.
  Janet has a degree in Graphic Design from the Royal Melbourne University of Technology and she has
  worked in London.
  Harold and Janet are both working in Melbourne as graphic designers.
  02> WILLIAMS, Anna Belinda m on 14.03.1998 to PRIDHAM, Anthony Robert
  b 02.01.1964
  b 16.04.1964
  Belinda b. at Gisborne. Address: "The Orange Chat", 159 Glenburn Road,
  Kinglake 3763, Vic, Australia.
  Belinda was educated in Gisborne, at Woodford House, Waikato University
  and at University in the USA. She is artistically gifted and has been an
  in-store designer with Smith and Caughey, David Jones, and Myers in
  Australia and with Harrods in London. She has worked in designing the All
  Star Cafe at the Melbourne Casino and Planet Hollywood Cafes.
  Tony is a wildlife artist exhibiting in Europe and USA.
  03> WILLIAMS, Thomas Hugh m on 27.05.1995 to FRAENKEL, Linda Jean
  b 02.01.1964
  b 06.12.1964
  Thomas b. at Gisborne. Address: 22 Domain Road, Waipawa, Hawkes Bay.
  Tom was educated in Gisborne and at Wanganui Collegiate School and University in the
  USA. He worked in Gisborne before going to "Aomarama" station in the South Island
  high country. He spent time in Australia before returning to manage "Awakeri" farm
  near Waipawa.
  01> WILLIAMS, Olivia Rose
  b 16.08.1996
